import React from 'react';

const Weakness = ({ pokemon }) => (

    <div>
        {pokemon.weaknesses.map(weakness => {
            return <div key={weakness.name}
            >
                <h2>Weak against:</h2>
                <h3>{weakness.type}, Damage: {weakness.value}</h3>
            </div>
        })}
    </div>
);

export default Weakness;
